Run a single intervention scenario with given criteria and parameters If each input was originally a table, this is equivalent to a running a single row from each (i.e., a unique combination of intervention and parameter values) Inputs: interv : table, row of intervention table criteria : table, row of criteria weights table params : table, row of environment parameter permutations ecol_params : table, row of ecological parameter permutations wave_scen : matrix[timesteps, nsites], spatio-temporal wave damage scenario dhw_scen : matrix[timesteps, nsites], degree heating weeek scenario alg_ind : int, algorithm choice (1, 2, 3) Example: [UNFINISHED] %Set up parameters
interv = interventionDetails();
criteria = criteriaDetails();
p_opts = [interv; criteria]; join tables together X ...; some sampling process map back to categorical options as necessary
X = convertScenarioSelection(X, p_opts) other parameters are static environmental and ecological parameter values etc
[params, ecol_params] = ADRIAparms(); %Load site data
[F0, xx, yy, nsites] = ADRIA_siteTable('MooreSites.xlsx');
[TP_data, site_ranks, strongpred] = siteConnectivity('MooreTPmean.xlsx', params.con_cutoff); ninter = height(X, 1);
alg_ind = 1; %Set up result array
Y = ... some NxD array where N is no. of sims and D is no. of outputs %Run simulations
parfor i = 1:ninter Y(i) = runADRIAScenario(IT(i, :), criteria_weights(i, :), ... param_tbl(i, :), ecol_tbl(i, :), ... TP_data, site_ranks, strongpred, nsites, ... w_scen, d_scen, alg_ind);
end %Save results
saveData(Y, "example_results.mat")
